import React from 'react';

const DynamicTBody = ({ data, fields }) => {
  return (
    <tbody>
      {data.map((item, index) => {
        return (
          // Usa el índice como key temporal
          <tr key={index}> 
            {fields.map((field) => (
              // Muestra el valor del campo en cada celda
              <td key={field}>{item[field]}</td>
            ))}
          </tr>
        );
      })}
    </tbody>
  );
};

export default DynamicTBody;
